import React from 'react';
import { Link } from 'react-router-dom';

const ResultPage = (props) => {
    const resultTable = props.location.state?.resultTable || [];

    return (
        <div className="background-grid home-page">
            <div className="center-content">
                <h1>Resultats</h1>
                <h3>bien jou√©</h3>
                <ul>
                    {resultTable.map((category) => (
                        <li key={category.categoryName}>
                            <strong>{category.categoryName}</strong>
                            <ul>
                                {category.jobs.map((job) => (
                                    <li key={job}>{job}</li>
                                ))}
                            </ul>
                        </li>
                    ))}
                </ul>
                <div className="ui-card ui-button-container">
                    <Link to="/tri-cartes/" className="button button-normal">
                        Home
                    </Link>
                </div>
            </div>
        </div>
    );
};

export default ResultPage;
